import React, { Component } from 'react';
import SweetAlert from 'sweetalert2-react';

export default class Kitchen extends React.Component {


  render(){
    return (
      <div id="tooltip" onClick={()=> {
        swal('Hi!',"Hello there!")
      }}>?</div>
    );
  }
}
